    const [show, setShow] = useState(true);

    return (
        <Container>
            <Row>
                <Col>1 of 3</Col>
                <Col lg={6}>2 of 3 (wider)</Col>
                <Col>3 of 3</Col>
            </Row>

        </Container>
    );
}

export default App;
